    'help.HowDoIUploadAPicture': '\u0645\u06CC\u06BA \u062A\u0635\u0648\u06CC\u0631 \u06A9\u06CC\u0633\u06D2 \u0627\u067E \u0644\u0648\u0688 \u06A9\u0631\u0648\u06BA\u061F',
