    'about.AboutText2': 'OLX \u062F\u0646\u06CC\u0627 \u0628\u06BE\u0631 \u0645\u06CC\u06BA \u06A9\u0627\u0645 \u06A9\u0631\u062A\u0627 \u06C1\u06D2 \u0627\u0648\u0631 \u0627\u0633 \u0648\u0642\u062A 40 \u0645\u0645\u0627\u0644\u06A9 \u0645\u06CC\u06BA \u0645\u0648\u062C\u0648\u062F \u06C1\u06D2\u06D4',
    'about.about_Body': '<p> OLX\u0645\u0641\u062A \u0622\u0646 \u0644\u0627\u0626\u0646 \u06A9\u0644\u0627\u0633\u06CC\u0641\u0627\u0626\u06CC\u0688\u0632 \u06A9\u06CC \u0646\u0626\u06CC \u0635\u0648\u0631\u062A \u06C1\u06D2\u06D4<br /><br />\u0622\u067E \u062C\u06C1\u0627\u06BA \u06A9\u06C1\u06CC\u06BA \u0628\u06BE\u06CC \u0631\u06C1\u062A\u06D2 \u06C1\u0648\u06BA<BRAND>>\u0622\u067E \u06A9\u0648 \u0627\u067E\u0646\u06D2 \u0627\u0631\u062F\u06AF\u0631\u062F \u0645\u0648\u062C\u0648\u062F \u0644\u0648\u06AF\u0648\u06BA \u06A9\u06D2 \u0633\u0627\u062A\u06BE \u062E\u0631\u06CC\u062F\u0648\u0641\u0631\u0648\u062E\u062A\u060C \u062A\u062C\u0627\u0631\u062A\u060C \u0628\u0627\u062A \u0686\u06CC\u062A\u060C \u062A\u0646\u0638\u06CC\u0645 \u0627\u0648\u0631 \u0645\u0644\u0627\u0642\u0627\u062A\u0648\u06BA \u0645\u06CC\u06BA \u062F\u0631\u067E\u06CC\u0634 \u067E\u062D\u0686\u06CC\u062F\u06AF\u06CC\u0648\u06BA \u06A9\u0627 \u0633\u0627\u062F\u06C1 \u062D\u0644 \u0641\u0631\u0627\u06C1\u0645 \u06A9\u0631\u062A\u0627 \u06C1\u06D2\u06D4<br /><br />OLX\u067E\u0631 \u0622\u067E \u0645\u0646\u062F\u0631\u062C\u06C1 \u0630\u06CC\u0644 \u06A9\u0627\u0645 \u06A9\u0631 \u0633\u06A9\u062A\u06D2 \u06C1\u06CC\u06BA:<br /><ul><li>\u0627\u0648\u0627\u06CC\u0644\u0627\u06CC\u06A9\u0633 \u067E\u0631 \u0622\u067E: \u0628\u0627\u0622\u0633\u0627\u0646\u06CC \u062E\u0634 \u0646\u0648 \u0627\u0634\u062A\u06C1\u0627\u0631\u0627\u062A \u0628\u0645\u06C1 \u062A\u0635\u0627\u0648\u06CC\u0631 \u0628\u0646\u0627 \u0633\u06A9\u062A\u06D2 \u06C1\u06CC\u06BA </li><li>\u0645\u06CC\u0631\u06D2OLX \u0645\u06CC\u06BA \u0627\u067E\u0646\u06CC \u062E\u0631\u06CC\u062F\u0648\u0641\u0631\u0648\u062E\u062A \u0627\u0648\u0631 \u06A9\u0645\u06CC\u0648\u0646\u0679\u06CC \u0633\u06D2 \u0645\u062A\u0639\u0644\u0642 \u0633\u0631\u06AF\u0631\u0645\u06CC\u0648\u06BA \u06A9\u0627 \u0627\u0646\u062A\u0638\u0627\u0645 \u0648 \u0627\u0646\u0635\u0631\u0627\u0645 \u06A9\u0631 \u0633\u06A9\u062A\u06D2 \u06C1\u06CC\u06BA</li><li>\u0627\u067E\u0646\u06CC \u0644\u0633\u0679\u0646\u06AF\u0632 \u0633\u0648\u0634\u0644 \u0646\u06CC\u0679 \u0648\u0631\u06A9\u0646\u06AF \u067E\u0631\u0648\u0641\u0627\u0626\u0644\uFD3F\u0645\u062B\u0644\u0627\u064BFacebook\u060CMyspace\u060C \u0648\u063A\u06CC\u0631\u06C1\uFD3E\u067E\u0631 \u062F\u06A9\u06BE\u0627 \u0633\u06A9\u062A\u06D2 \u06C1\u06CC\u06BA</li><li>\u0627\u067E\u0646\u06D2 \u0645\u0648\u0628\u0627\u0626\u0644 \u0641\u0648\u0646 \u067E\u0631 \u0633\u0627\u0626\u0679 \u06A9\u06BE\u0648\u0644 \u0633\u06A9\u062A\u06D2 \u06C1\u06CC\u06BA</li><li>\u0627\u067E\u0646\u06CC \u0645\u0642\u0627\u0645\u06CC \u0632\u0628\u0627\u0646 \u0645\u06CC\u06BAOLX\u062F\u06CC\u06A9\u06BE \u0633\u06A9\u062A\u06D2 \u06C1\u06CC\u06BA\u06D4</li></ul>OLX\u06A9\u0648<<QTY_COUNTRIES>> \u0645\u0645\u0627\u0644\u06A9 \u0645\u06CC\u06BA<<QTY_LANGUAGES>>\u0632\u0628\u0627\u0646\u0648\u06BA \u0645\u06CC\u06BA \u0627\u0633\u062A\u0639\u0645\u0627\u0644 \u06A9\u06CC\u0627 \u062C\u0627\u062A\u0627 \u06C1\u06D2\u06D4\u06A9\u0645\u067E\u0646\u06CC \u06A9\u0627 \u0642\u06CC\u0627\u0645 \u0645\u0627\u0631\u06862006\u0645\u06CC\u06BA \u0639\u0645\u0644 \u0645\u06CC\u06BA \u0622\u06CC\u0627 \u0627\u0648\u0631 \u06CC\u06C1 \u067E\u0631\u0627\u0626\u06CC\u0648\u06CC\u0679 \u0645\u0644\u06A9\u06CC\u062A \u06C1\u06D2\u06D4</p>',
